// MainApp.js

import React from 'react';
import {Routes, Route} from 'react-router-dom';
import App from './App';
import UserProfile from './UserProfile';
import LoginPage from './LoginPage';
import RegisterPage from './RegisterPage';
import PostPage from './PostPage'; // Import the PostPage component
import './App.css';

const MainApp = () => {
    const storedToken = sessionStorage.getItem('token');

    return (
        <Routes>
            <Route path="/login" element={<LoginPage/>}/>
            <Route path="/register" element={<RegisterPage/>}/>
            <Route path="/posts" element={<App/>}/>
            <Route path="/users/:userId" element={<UserProfile token={storedToken}/>}/>
            <Route path="/post/:post_id"
                   element={<PostPage token={token} decodedToken={decodedToken} handleLogout={handleLogout}/>}/>
        </Routes>
    );
};

export default MainApp;
